import React from 'react';
import '../ItemPage2/ItemPage2.css';
import { Row, Col, Button } from 'react-bootstrap';

import {Box} from '../../components/Box/Box.js';
import {SubBox} from '../../components/SubBox/SubBox.js';

const ItemPage2 = () => {
    return(
        <>
        <Row>
            <Col>
                <Box text="*Video2*" />
            </Col>
            <Col>
                <Box text="*Settings or this space can be filled for bigger video resolution*" />
            </Col>
        </Row>
        <br></br>
        <br></br>
        {/* <Row>
            <Box text="*Description*" />
        </Row> */}
        <Box style={{height: "200px"}} text="*Description*" />
        <Button href="/ItemPage3">Item Page 3</Button>
        </>
    )
}

export default ItemPage2;
